                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé dans le centre de Bordeaux, dans le quartier de Mériadeck, l’Appart'City Classic Bordeaux Centre propose des appartements modernes dotés d’une télévision et d’une salle de bains privative. Vous séjournerez au cœur du quartier des affaires, à seulement 20 km de l’aéroport de Bordeaux. Les appartements spacieux sont munis d’une connexion Internet gratuite. Tous comprennent un coin repas ainsi qu’une kitchenette pourvue d’un micro-ondes et d’un réfrigérateur. Tous les appartements sont desservis par un ascenseur. Cet Appart'City sert un petit-déjeuner buffet chaque matin. Le petit-déjeuner se compose de yaourts, de boissons chaudes et froides ainsi que d’un choix de pains, tels que des viennoiseries. L’Appart'City Classic Bordeaux Centre se trouve à seulement 550 mètres de l’arrêt de tramway le plus proche. Vous pourrez ainsi aisément accéder au centre-ville. La gare TGV de Bordeaux Saint-Jean est à 3,6 km. Un parking public sécurisé est disponible sur place. Vous pourrez y bénéficier de tarifs préférentiels et vous y garer en fonction des disponibilités à votre arrivée.",
