                    "zone_rank": 48.606489598185,
                    "hotel_description": "L’Aparthotel Adagio Access Bordeaux Rodesse propose des hébergements à seulement 10 minutes de marche du centre-ville de Bordeaux et de l'hôtel de ville. Une connexion Wi-Fi est disponible gratuitement. Les studios et les appartements comprennent une salle de bains privative ainsi qu’une cuisine entièrement équipée. Un kit composé d’une éponge, de liquide vaisselle et d’un torchon est fourni. Un parking privé est accessible moyennant des frais supplémentaires. Vous trouverez également sur place une salle de petit-déjeuner et une laverie en libre-service. La piscine extérieure, ouverte de la mi-juin à la mi-septembre, est commune à d’autres établissements. L’Adagio Access Bordeaux Rodesse est situé dans le quartier moderne de Mériadeck, à Bordeaux, doté d’un grand centre commercial. Un arrêt de tramway se trouve à proximité.",
