                    "name": "32m quiet in the center of Bordeaux",
                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé à moins de 1 km du musée d'art contemporain CAPC et à 10 minutes à pied de l'esplanade des Quinconces, le 32m quiet in the center of Bordeaux propose un hébergement dans un quartier central de Bordeaux. Cet appartement se trouve à 1,3 km du musée d'Aquitaine et à 1,8 km du musée du Vin et du Négoce. Offrant une vue sur la ville, cet appartement comprend un balcon, une chambre, un salon, une télévision, une cuisine équipée avec un réfrigérateur et un lave-vaisselle ainsi qu'une salle de bains pourvue d'une baignoire ou d'une douche. Les serviettes et le linge de lit sont fournis. Vous séjournerez à proximité du Grand Théâtre de Bordeaux, de la cathédrale Saint-André et de la place de la Bourse. L'aéroport de Bordeaux-Mérignac, le plus proche, est implanté à 10 km.",
