                    "hotel_description": "Situé dans le centre de Bordeaux, à 100 mètres de la place des Grands Hommes, des Allées de Tourny et de la place Gambetta, l'Hôtel La Cour Carrée est un établissement de charme climatisé et doté d'une connexion Wi-Fi gratuite. Occupant un bâtiment vieux de 200 ans, il propose des hébergements élégamment décorés et une terrasse. La plupart des chambres de style contemporain disposent de poutres en bois et de murs en pierres apparentes. Toutes possèdent une télévision à écran LCD et certaines sont pourvues d'un coin salon. Leur salle de bains privative est munie d'une baignoire ou d'une douche. Un petit-déjeuner buffet est préparé chaque matin sur place. Vous trouverez de nombreux magasins ainsi que des navettes pour l'aéroport de Bordeaux et la gare Saint-Jean à 100 mètres, sur la place Gambetta.",
