                    "hotel_description": "Situé au cœur du centre historique de Bordeaux, Le Boutique Hotel occupe une maison de ville du XVIIIe siècle entourée d'une cour à la végétation luxuriante. Cet hôtel dispose d'une terrasse de 140 m2 ombragée par un châtaignier centenaire, d'un toit aménagé, d'une piscine intérieure de 2,5 x 7 mètres, d'un sauna et d'un hammam. Les chambres et les appartements climatisés du Boutique Hotel disposent d'une télévision par satellite à écran LCD et d'une machine à café Nespresso. Un petit-déjeuner continental est servi chaque matin. Par beau temps, vous pourrez prendre un verre au bar à vin sur la terrasse. Connexion Wi-Fi. L’hôtel se trouve à une minute à pied de la place Gambetta et à 850 mètres du quai Louis XVIII. Vous bénéficierez d'une réduction au parking public situé à 200 mètres de l'hôtel.",
