                    "zone_rank": 0,
                    "hotel_description": "Doté d'une terrasse et d'une connexion Wi-Fi gratuite, l'Appartements Emile Fourcand est situé dans le centre de Bordeaux, à proximité du CAPC Musée d'art contemporain, de l'Esplanade des Quinconces et du Grand Théâtre de Bordeaux. Les logements comprennent la climatisation, une cuisine entièrement équipée, une télévision à écran plat ainsi qu'une salle de bains privative pourvue d'une douche, d'articles de toilette gratuits et d'un sèche-cheveux. Un réfrigérateur, un micro-ondes, des plaques de cuisson, une machine à café et une bouilloire sont également fournis. Vous séjournerez à proximité de la place de la Bourse, du musée du vin et du commerce et de la cathédrale Saint-André. L'aéroport de Bordeaux-Mérignac, le plus proche, est implanté à 10 km.",
