                    "hotel_description": "Idéalement situé dans le centre de Bordeaux, le Burdigala Homes - Appart du Vieux Marché offre une vue sur la ville et dispose d'un salon commun. La grosse cloche de Bordeaux et le musée d'Aquitaine se trouvent à moins de 300 mètres et à 400 mètres. Une connexion Wi-Fi est disponible gratuitement. L'appartement comprend 4 chambres, une cuisine avec réfrigérateur et four, ainsi qu'une salle de bains avec douche, articles de toilette gratuits et lave-linge. Il dispose également d'une télévision à écran plat ainsi que de lecteurs CD et DVD. Vous séjournerez à proximité de la basilique Saint-Michel, de la cathédrale Saint-André et du pont de pierre. L'aéroport de Bordeaux-Mérignac, le plus proche, est implanté à 13 km.",
