                    "hotel_description": "Le Victoria Garden Bordeaux Centre est situé dans le centre-ville de Bordeaux, à 8 km du nouveau stade et à 15 minutes en tramway de l’opéra national ainsi que de la cathédrale Saint-André. L’établissement propose des appartements climatisés. Les appartements du Victoria Garden Bordeaux Centre comportent une télévision à écran LCD et une connexion Wi-Fi. La salle de bains est pourvue d’un sèche-cheveux et la kitchenette est équipée d’un micro-ondes et d’un réfrigérateur. Un petit-déjeuner buffet est servi tous les matins dans la salle de petit-déjeuner du Victoria Garden Bordeaux Centre. Veuillez noter que la résidence dispose d'un parking privé payant (12 EUR par jour). L’arrêt de tramway Place de la Victoire, à 500 mètres, vous permettra de rejoindre directement le musée d’Aquitaine.",
