                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé au cœur de Bordeaux, le Duplex La Fusterie - FREE Parking - Garonne View - SuperBordeaux vous accueille à seulement 200 mètres de la basilique Saint-Michel et à 400 mètres du pont de pierre. Aménagé sur 2 niveaux, le Duplex La Fusterie - Super Bordeaux comprend un salon avec connexion Wi-Fi gratuite, télévision et home cinéma. Il possède une chambre en mezzanine et une salle de bains avec douche à l'italienne. Cet appartement est installé au 5ème étage et n'est pas desservi par un ascenseur. Vous trouverez différents bars et restaurants à proximité. Le logement est équipé d'une cuisine avec four et micro-ondes. Un lave-linge et du matériel de repassage sont à votre disposition. L'emplacement de l'appartement en fait un excellent point de départ pour découvrir Bordeaux et sa grosse cloche, à 650 mètres. L'arrêt de tramway Saint-Michel est accessible en moins de 5 minutes de marche. Le parking Bourse & Jean-Jaurès se trouve à 700 mètres.",
