                    "zone_rank": 13.98870017246825,
                    "hotel_description": "L’hôtel 4 étoiles Novotel Bordeaux Centre Gare Saint Jean est situé à 50 mètres de l’arrêt de tramway C, à 3 arrêts de tramway du centre de Bordeaux et de la place de la Bourse et à seulement 400 mètres de la gare. L’établissement dispose d’une réception ouverte 24h/24. Vous bénéficierez gratuitement d’une connexion Wi-Fi dans l’ensemble des locaux. Les spacieuses chambres du Novotel Bordeaux comportent un bureau, un plateau de courtoisie, un téléphone et la climatisation à réglage individuel. La salle de bains privative est pourvue d’une baignoire ou d’une douche, d’un sèche-cheveux ainsi que de toilettes séparées. Vous pourrez profiter d’un buffet américain au Novotel Bordeaux Gare Saint Jean. Le matin, vous pourrez prendre le petit-déjeuner dans le confort de votre chambre ou dans la salle prévue à cet effet. Le restaurant de l’hôtel prépare une cuisine française traditionnelle. L’établissement possède 3 salles de réunion. L’hôtel est implanté à moins de 40 minutes en voiture des vignobles de Saint-Émilion ainsi que du bassin d’Arcachon. L’aéroport de Bordeaux - Mérignac se trouve, quant à lui, à 13 km. Par ailleurs, vous pourrez profiter d’un parking intérieur moyennant des frais supplémentaires.",
