                    "zone_rank": 0,
                    "hotel_description": "Situé à Bordeaux, à moins de 1 km de la basilique Saint-Michel, l'Hôtel Life Bordeaux Gare - BG propose un service de concierge, des chambres non-fumeurs, une salle de sportVous profiterez d'une connexion Wi-Fi gratuite dans l'ensemble des locaux et d'un salon commun. Doté d'un bar, l'hôtel se trouve à proximité de plusieurs attractions réputées, à environ 1,3 km du pont de pierre, à 1,4 km de la grosse cloche de Bordeaux et à 1,7 km du musée d'Aquitaine. Des animations sont organisées en soirée et un service d'étage est assuré. Toutes les chambres sont équipées de la climatisation et d'une télévision à écran plat. Un petit-déjeuner buffet, continental ou végétarien est servi tous les matins sur place. Le personnel de la réception ouverte 24h/24 parle arabe, allemand, anglais et espagnol. Vous séjournerez à 2,6 km de la cathédrale Saint-André et à 1,8 km de la place de la Bourse. L'aéroport de Bordeaux-Mérignac, le plus proche, est à 14 km.",
