                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé à Bordeaux, le Mercure Bordeaux Gare Atlantic propose un hébergement 4 étoiles avec une terrasse et un bar. Doté d'un salon commun, cet hôtel 4 étoiles propose des chambres climatisées avec connexion Wi-Fi gratuite et salle de bains privative. Vous profiterez d'une cuisine commune et d'un service d'étage. Toutes les chambres comprennent une télévision par câble à écran plat, une bouilloire, une douche, des articles de toilette gratuits et un bureau. Les chambres sont équipées d'un coffre-fort. Certaines possèdent également un balcon et d'autres offrent une vue sur la ville. Le linge de lit et les serviettes sont fournis. Un petit-déjeuner buffet, continental ou végétarien est servi chaque matin. Le restaurant du Mercure Bordeaux Gare Atlantic sert une cuisine française. Des plats végétariens, végétaliens et sans produits laitiers sont également disponibles sur demande. Parlant anglais, espagnol, français et italien, le personnel de la réception se fera un plaisir de vous fournir des informations pratiques sur la région. Vous séjournerez à proximité du pont de pierre, de la basilique Saint-Michel et de la grosse cloche de Bordeaux. L'aéroport de Bordeaux-Mérignac, le plus proche, est à 14 km.",
