                    "hotel_description": "Installé à seulement 30 mètres de la gare Saint-Jean, l'ibis Bordeaux Centre Gare Saint Jean Euratlantique est situé sur une place piétonne, à 20 minutes à pied ou à 5 minutes en tramway du centre-ville de Bordeaux. Les chambres comprennent une connexion Wi-Fi gratuite et une télévision à écran LCD avec les chaînes Canal +. Elles sont agrémentées d'une décoration contemporaine avec des tons chauds. Un petit-déjeuner buffet composé de plats sucrés et salés tels que des œufs, de la salade de fruits, des yaourts et des jus de fruits est servi tous les matins. Des viennoiseries cuites sur place et des madeleines françaises fraîches sont aussi proposées, ainsi qu'une boisson chaude et un fruit à emporter. En dehors des heures régulières, un petit-déjeuner plus léger est disponible à partir de 4h00. L'établissement possède une bagagerie gratuite, ainsi qu'une réception ouverte 24h/24. De plus, il pourra vous renseigner sur les restaurants voisins. En tramway, vous rejoindrez facilement la rue Sainte-Catherine, la cathédrale et la place de la Bourse de Bordeaux.",
