                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "L’hôtel 3 étoiles Campanile Bordeaux Centre - Gare Saint-Jean est situé à 100 mètres de la gare de Bordeaux et d’un arrêt de tramway de la ligne C. Vous pourrez rejoindre le centre historique en 10 minutes à pied. La salle omnisports Bordeaux Métropole Arena se trouve à seulement 3 km. Les chambres modernes sont dotées d’une télévision par satellite à écran plat et d’une connexion Wi-Fi gratuite. Elles disposent d’un bureau, d’un plateau de courtoisie, d’un téléphone et d’un système de chauffage/climatisation à réglage individuel. Leur salle de bains est pourvue d’une grande douche à l’italienne, d’un sèche-cheveux et d’articles de toilette. Dans le salon, vous aurez la possibilité de déguster à tout moment une sélection de vins de Bordeaux, accompagnée de collations sucrées ou salées. Un service d’étage est assuré tous les soirs. Le matin, un petit-déjeuner buffet composé de produits locaux et bio est servi dans la salle de petit-déjeuner ou sur la terrasse. Doté du label écologique européen, le Campanile Bordeaux Centre - Gare Saint-Jean s’applique à concilier votre confort et des méthodes respectueuses de l’environnement. Les vignobles de Saint-Émilion ainsi que les routes des vins du Médoc et du bassin d’Arcachon sont à seulement 40 minutes de route. Directement accessible par le tramway, le stade Matmut Atlantique est distant de 11 km. L’aéroport de Bordeaux-Mérignac se trouve à 13 km.",
