                    "zone_rank": 76.05297583409079,
                    "hotel_description": "Le City Résidence Bordeaux Centre se situe au cœur du quartier des Chartrons de la vieille ville. Les arrêts de tramway Chartrons et Cours du Médoc sont à 200 mètres. Le centre-ville de Bordeaux est accessible en 15 minutes de tramway. Ces appartements et studios modernes possèdent une connexion Wi-Fi gratuite. Tous les appartements disposent de la climatisation. Vous disposerez d'une télévision à écran plat, d'un bureau et d'une salle de bains avec un sèche-cheveux. La kitchenette est équipée d'un micro-ondes, de plaques de cuisson et d'un réfrigérateur. Le linge de lit et les serviettes sont fournis. Chaque matin, vous dégusterez un petit-déjeuner buffet dans la salle à manger. La Garonne est à 600 mètres du City Résidence Bordeaux Centre, tandis que les commerces se trouvent à 300 mètres. Enfin, l'esplanade des Quinconces est installée à 2,5 km. Un parking couvert est également disponible sur place.",
