                    "name": "Mercure Bordeaux Chateau Chartrons",
                    "hotel_zone": "Bordeaux",
                    "zone_rank": 82.5322290251122,
                    "hotel_description": "Implanté dans l’ancien quartier de négoce de vins, le Mercure Bordeaux Chateau Chartrons n’est qu’à 5 minutes de route du centre-ville de Bordeaux et à 4,5 km du Nouveau Stade Bordeaux. Il propose des hébergements élégants et une terrasse meublée. Spacieuses et climatisées, les chambres sont décorées dans un style contemporain. Elles sont équipées de tout le confort moderne, notamment d’une télévision par satellite à écran plat, d’une connexion Wi-Fi gratuite et d’une salle de bains privative. Le restaurant s'appelle désormais le Jardin d'Hiver. Il sert des dîners et non des petits-déjeuners. La cuisine n'est pas « française traditionnelle », mais une cuisine contemporaine, à base de produits frais et de saison, avec des notes multiculturelles. Le tout dans un cadre tropical. Enfin, après sa rénovation, ce restaurant ne possède plus de terrasse. Un parking couvert privé est disponible moyennant un supplément. Le Mercure Bordeaux Chateau Chartrons est installé à proximité des rives de la Garonne et à seulement 15 minutes à pied du CAPC musée d'art contemporain de Bordeaux.",
