                    "hotel_description": "Situé à Bordeaux, le MEININGER Hotel Bordeaux Gare Saint-Jean dispose d'un salon commun, d'une terrasse, d'un bar et d'une connexion Wi-Fi gratuite dans l’ensemble de ses locaux. L'établissement se trouve à 1,9 km du pont de pierre, à 2,2 km de la Grosse cloche et à 1,6 km de la basilique Saint-Michel. Une cuisine commune et une bagagerie sont également mises à votre disposition. Les chambres de l’hôtel possèdent un bureau, une télévision à écran plat et une salle de bains privative. Les serviettes de toilette et le linge de lit sont fournis. Le MEININGER Hotel Bordeaux Gare Saint-Jean sert un petit-déjeuner buffet et continental tous les matins. Le personnel de la réception parle anglais, espagnol, français et italien. Le musée d'Aquitaine se trouve à 2,4 km de l'hébergement, tandis que la place de la Bourse est à 2,5 km. L’aéroport de Bordeaux-Mérignac, le plus proche, se trouve à 14 km du MEININGER Hotel Bordeaux Gare Saint-Jean.",
