                    "hotel_description": "Le Residhotel Galerie Tatry propose des appartements indépendants situés à 10 minutes en tramway du centre de Bordeaux. Le Nouveau Stade de Bordeaux se trouve à 4 km. Les appartements du Galerie Tatry sont climatisés (selon la saison) et présentent une décoration moderne. Ils comprennent tous un coin salon avec télévision par satellite, ainsi qu'une kitchenette équipée d’un micro-ondes et d’un réfrigérateur. Le linge de lit et de toilette vous sera fourni. Chaque matin, vous pourrez savourer un petit-déjeuner buffet dans la salle à manger contemporaine de la résidence. Le Galerie Tatry met également à votre disposition des journaux gratuits et une bagagerie. L’arrêt de tramway Grand Parc (ligne C) se trouve juste en face de l’établissement. Le palais des congrès de Bordeaux est quant à lui situé à 10 minutes de route.",
