                    "hotel_description": "Le Light 60 m with terrace in the heart of Chartrons est situé dans le quartier des Chartrons à Bordeaux, à 1,3 km du musée du vin et du commerce, du pont Chaban Delmas et à 1,4 km de la Cité du Vin. Offrant une vue sur la ville, il dispose d'une terrasse et d'une connexion Wi-Fi gratuite. Cette maison de vacances comprend une chambre, un salon, une cuisine entièrement équipée avec un réfrigérateur et une machine à café ainsi qu'une salle de bains pourvue d'une baignoire ou d'une douche et d'un sèche-cheveux. Les serviettes et le linge de lit sont fournis. Vous séjournerez à 2,3 km du CAPC musée d'art contemporain et à 2,8 km de l'esplanade des Quinconces. L'aéroport de Bordeaux-Mérignac, le plus proche, est implanté à 14 km.",
