                    "hotel_description": "L'Appart-Hôtel Mer & Golf City Bordeaux Lac vous propose des hébergements indépendants et climatisés, à 5 minutes de route du parc des expositions de Bordeaux ainsi que du Matmut Atlantique, le nouveau stade de Bordeaux. Il vous accueille à 20 mètres d'un centre aquatique de 4 000 m², où vous pourrez profiter de tarifs réduits. Il est également doté d'une connexion Wi-Fi gratuite. Les appartements disposent d'une télévision à écran plat, d'un balcon et d'un coin salon. Leur salle de bains est pourvue d'une douche ou d'une baignoire. Sur demande, vous pourrez bénéficier d'une vue sur le lac, sous réserve de disponibilité et moyennant des frais supplémentaires. L'établissement possède un restaurant avec terrasse servant des plats français en semaine. Les hébergements comprennent par ailleurs une kitchenette avec micro-ondes, réfrigérateur et lave-vaisselle. Un petit-déjeuner buffet est dressé tous les matins. À 800 mètres, vous trouverez les stations de tramway Les Aubiers et La Vache sur la ligne C ainsi que la station Cracovie à 900 mètres. Vous pourrez ainsi rejoindre le centre historique de Bordeaux, la gare, le casino, le centre des expositions et le nouveau stade. Le bus 15, accessible à 300 mètres, permet d'accéder au centre-ville de Bordeaux, à la station de tramway Les Aubiers et au centre commercial Auchan Lac.",
