                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé à Bordeaux, le Moxy Bordeaux dispose d'un salon commun, d'une terrasse, d'un restaurant et d'un bar. Doté d’un jardin, cet hôtel 3 étoiles propose des chambres pourvues de la climatisation, d’une connexion Wi-Fi gratuite et d’une salle de bains privative. Cet établissement non-fumeurs se trouve à 300 mètres de la Cité du Vin. Les chambres de l’hôtel disposent d’un bureau. Toutes les chambres du Moxy Bordeaux comprennent un coin salon et une télévision par câble à écran plat. Un petit-déjeuner buffet, continental ou américain est servi tous les matins. Vous pourrez jouer au ping-pong dans cet hôtel 3 étoiles. Le personnel de la réception ouverte 24h/24 parle français, anglais et espagnol. Vous séjournerez à moins de 1 km du pont Chaban Delmas et à 2,7 km du musée du vin et du négoce. L'aéroport de Bordeaux-Mérignac, le plus proche, se trouve à 18 km du Moxy Bordeaux.",
