                    "name": "Appart-Hôtel Mer & Golf City Bordeaux Bassins à flot",
                    "hotel_zone": "Bordeaux",
                    "zone_rank": 79.54167307719125,
                    "hotel_description": "Doté d’une terrasse bien exposée, l’Appart-Hôtel Mer & Golf City Bordeaux Bassins à flot est situé à Bordeaux, à 200 mètres de la Cité du vin, à 300 mètres du musée de la Mer et de la Marine, ainsi qu’à 700 mètres du pont Chaban-Delmas. Tous les logements climatisés de cet établissement acceptant les animaux domestiques comprennent une télévision par satellite à écran plat et un coin repas. Certains possèdent une grande terrasse. La kitchenette est équipée d’un lave-vaisselle, d’un micro-ondes, d’un grille-pain, d’un réfrigérateur, d’une machine à café et d’une bouilloire. Chaque chambre donne sur une zone piétonne. L’Appart-Hôtel Mer & Golf City Bordeaux Bassins à flot sert un petit-déjeuner buffet chaque matin. Vous rejoindrez aussi de nombreux restaurants et un supermarché à moins de 50 mètres. Vous séjournerez à 2,6 km du musée d'art contemporain CAPC. L’aéroport de Bordeaux-Mérignac, est à 12 km de là. Les tramways pour le centre-ville historique s’arrêtent à seulement 400 mètres. Le stationnement est possible dans un garage couvert, sous réserve de disponibilité. Un parking supplémentaire est disponible au parking de la Cité du Vin, situé à 50 mètres.",
