                    "name": "Whoo Bordeaux Bacalan - Hostel",
                    "hotel_zone": "Bordeaux",
                    "zone_rank": 0,
                    "hotel_description": "Situé à Bordeaux, à moins de 400 mètres de la Cité du Vin, le Whoo Bordeaux Bacalan - Hostel propose un service de concierge, des chambres non-fumeurs, une terrasse, une connexion Wi-Fi gratuite dans l'ensemble de ses locaux et un bar. Vous séjournerez à moins de 1 km du pont Chaban Delmas, à 2,8 km du musée du vin et du commerce et à 3,4 km de la place de la Bourse. L'établissement propose des animations en soirée et un bureau d'excursions. Toutes les chambres comprennent une armoire. Le linge de lit est fourni. Un petit-déjeuner à la carte, continental et américain est servi tous les matins. Parlant allemand, anglais, espagnol et français, le personnel de la réception ouverte 24h/24 se fera un plaisir de vous fournir des informations pratiques sur la région. Vous séjournerez à 3,6 km du Grand Théâtre de Bordeaux et du CAPC musée d'art contemporain. L'aéroport de Bordeaux-Mérignac, le plus proche, est à 18 km.",
