                    "hotel_description": "Situé à Gradignan, cet hôtel abordable se trouve à 14 km de la ville historique de Bordeaux. Il propose un hébergement dans un jardin bordé d'arbres. Les chambres climatisées du Bordeaux Gradignan-Talence présentent une décoration moderne. Toutes les chambres sont équipées d'un plateau/bouilloire et d'une salle de bains privative. Un petit-déjeuner buffet est servi chaque matin dans la salle à manger lumineuse. Après le petit-déjeuner, vous pourrez utiliser la connexion Wi-Fi gratuite disponible dans tout l'hôtel. Vous pourrez également déguster un buffet d'entrées et de desserts au restaurant. Il dispose d'un parking privé gratuit sur place et d'une borne électrique. Cet hôtel Campanile est accessible par les autoroutes A10 et A62, sortie 16. Station de recharge pour voiture électrique avec électra, nous vous offrons la possibilité de recharger votre voiture électrique, électra dispose de 2 bornes de recharge avec 4 places, situé juste en face de l'hôtel (extérieur).",
